import React from 'react';
import "../style/gradient.css";
import "../style/homestyles.css";
import GradientHeader from '../components/GradientHeader';
import 'bootstrap/dist/css/bootstrap.min.css';
import {StandardButton, WorkoutLink} from '../components/Buttons.js';


const Home = () => {
  return (
    <div className="container">
      <GradientHeader />
      <GetStarted />
      <Achievements />
      <RecentWorkouts />
    </div>
  )
};

const GetStarted = () => {
  return (
    <div id="get_started">
      <div id="text_box">Let's get started</div>
      <div id="start_workout">
        <StandardButton text="Start a Workout" />
      </div>
    </div> 
  )
}

const Achievements = () => {
  return (
    <div id="achievements">
      <div id="text_box">Achievements</div>
      <div id="badges">

      </div>
    </div>
  )
}

const Badge = ({title, icon}) => {
  return (
    <div className="badge">

    </div>
  )

}

const RecentWorkouts = () => {
  return (
    <div id="achievements">
      <div id="text_box">Recent Workouts</div>
      <div id="previous_workouts">
        <WorkoutLink datetime="Oct 29, 2023 2:10 PM" length="20:15 minutes" />
      </div>
    </div>
  )
}


export default Home;
